import React from 'react';
import '../App.css';


const Info = () => {
    return (
        <div className="info">
            <div>
                <div className="info_header">Object Oriented Programming </div>
                <div className="info_text">The design of the Python language<br/> is built around an object-oriented programming model. The implementation of OOP in Python is elegant, powerful, and well-designed, but at the same time quite specific compared to other object-oriented languages .</div>
            </div>
            <div>
            <div className="info_header">Object Oriented Programming </div>
                <div className="info_text">The design of the Python language<br/> is built around an object-oriented programming model. The implementation of OOP in Python is elegant, powerful, and well-designed, but at the same time quite specific compared to other object-oriented languages .</div>
            </div>
        </div>

    );
}

export default Info;
